let initialState= {
  userId:null,
  userName: "",
  userAge: "",
  userTitle: "",
  userCourseDetails: {
    course: "",
    branch: "",
    year: ""
  },
  userProfilePicture: ""
}
let userDetatil= (state=null, action)=>{
    switch (action.type) {
      case "USER_DETAIL":
        return action.payload;
      default:
        return {};    
    }
  }

  export {userDetatil};
